import React from "react";
const App=(prop)=>{
    const{x, y, z}=prop;
    return(<>
    {(x===y && y===z)? (<>
    <p>{x}   {y}   {z}</p>
    <h4 style={{color:"green"}}>Maching</h4>
</>
):(<> <p>{x}   {y}   {z}</p>
    <h4 style={{color:"Red"}}>Not Maching</h4>
   </>)}
    </>
        
    )
}

export default App;
